  #
  # conversion functions
  #
  function emoji_smileys_convert($text, $map) {
    return str_replace(array_keys($GLOBALS['emoji_maps'][$map]), $GLOBALS['emoji_maps'][$map], $text);
  }

  function emoji_smileys_unified_to_tag($text) { return emoji_smileys_convert($text, 'unified_to_tag'); }
  function emoji_smileys_tag_to_html($text) { return emoji_smileys_convert($text, 'tag_to_html'); }


  function emoji_smileys_get_name($unified_cp){
    return $GLOBALS['emoji_maps']['names'][$unified_cp] ? $GLOBALS['emoji_maps']['names'][$unified_cp] : '?';
